import './App.css'
import freCodecamp from './imagenes/FreeCodeCamp_logo.svg.png'

function App() {
  return (
    <div className="App">
      <div className='freecodecamp-logo-contenedor'>
        <img 
          className='freecodecamp-logo'
          src={freCodecamp}
          alt='LOgo de freeCodecamp'
        />

      </div>

    </div>
  );
}

export default App;
